function Start()
	local flCooldownBase =	FL_COOLDOWN1;
	
	Hydra.Wait(FL_DUNGEONAFFIX_COOLUP);

	-- If this is not a dungeon, stop
	if not Hydra.SubzoneIsDungeon() then
		return;
	end
	
	while (true) do
		-- Shorten the cooldown after first stage
		if gb_FirstStageDone then
			flCooldownBase = FL_COOLDOWN2;
		end

		-- Find valid players
		local tPlayer = Hydra.PlayerActors();
		local idPlayerValid = Hydra.ACDID_INVALID;
		for i, idPlayer in ipairs(tPlayer) do
			if Hydra.ActorIsValid(idPlayer) then
				idPlayerValid = idPlayer;
				break;
			end
		end

		if not Hydra.ActorIsValid(idPlayerValid) then
			Hydra.Wait(flCooldownBase);
		else
			-- First check to see whether any player is in combat
			local tPlayersValid = {};
			for i, idPlayer in ipairs(tPlayer) do
				if Hydra.ActorIsValid(idPlayer) and Hydra.ActorIsAlive(idPlayer) and Hydra.ActorIsInCombat(idPlayer) then
					table.insert(tPlayersValid, idPlayer);
				end
			end
			local nPlayerValidCount = #tPlayersValid;
			if nPlayerValidCount <= 0 then
				Hydra.Wait(flCooldownBase);
			else
				-- Calculate the cooldown based on player count
				local flCooldown = flCooldownBase / (1 + (nPlayerValidCount - 1) * FL_COOLDOWN_EXTRAPLAYER);

				-- Only trigger in chance
				if Hydra.GetRandomFloat() <= FL_CHANCE then
					-- Spawn it under a random player
					ShuffleTable(tPlayersValid);
					
					local idPlayerPicked = Hydra.ACTORID_INVALID;
					for i, idPlayer in ipairs(tPlayersValid) do
						if gpt_LastVolcanic == nil or not Hydra.PositionIsValid(gpt_LastVolcanic) then
							idPlayerPicked = idPlayer;
							break;
						end
						local ptPlayer = Hydra.ActorGetPosition(idPlayer);
						if Hydra.PositionGetDistanceSquaredToPosition(ptPlayer, gpt_LastVolcanic) > FL_DISTANCESQ_MIN then
							idPlayerPicked = idPlayer;
							break;
						end
					end
					if not Hydra.ActorIsValid(idPlayerPicked) then
						idPlayerPicked = tPlayersValid[1];
					end
					if Hydra.ActorIsValid(idPlayerPicked) then
						-- Trigger the volcanic at player's feet
						gpt_LastVolcanic = Hydra.ActorGetPosition(idPlayerPicked);
						Hydra.ActorTriggerEnvironmentPower(idPlayerPicked, idPlayerPicked, S_VOLCANIC_POWER, Hydra.TEAM_MONSTER_0);
					end
				end

				Hydra.Wait(flCooldown);
			end
		end
	end -- while loop
end

